(1, '<div class=\"demo-inline\">\r\n<div class=\"container\">\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://www.tiny.cloud/images/email-banner-2.png\" /></p>\r\n<h1 class=\"tinymce-heading\" style=\"text-align: center;\">The world&rsquo;s first rich text editor in the cloud</h1>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://www.tiny.cloud/images/image-two.jpg\" /></p>\r\n<div class=\"tinymce-body\">\r\n<p style=\"text-align: justify;\">Have you heard about Tiny Cloud? It&rsquo;s the first step in our journey to help you deliver great content creation experiences, no matter your level of expertise. 50,000 developers already agree. They get free access to our global CDN, image proxy services and auto updates to the TinyMCE editor. They&rsquo;re also ready for some exciting updates coming soon.</p>\r\n<p><img style=\"float: right;\" src=\"images/Screenshot from 2020-11-09 13-23-04.png\" alt=\"\" width=\"807\" height=\"267\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2><span style=\"color: #e03e2d;\">Esta &eacute; uma Imagem -&gt;&gt;&gt;&gt;</span></h2>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\">One of these enhancements is <strong>Tiny Drive</strong>: imagine file management for TinyMCE, in the cloud, made super easy. Learn more at <a href=\"tinydrive/\">tiny.cloud/tinydrive</a>, where you&rsquo;ll find a working demo and an opportunity to provide feedback to the product team.</p>\r\n</div>\r\n</div>\r\n<h2 class=\"tinymce-heading\" style=\"text-align: justify;\">An editor for every project</h2>\r\n<div class=\"tinymce-body\">\r\n<p style=\"text-align: justify;\">Here are some of our customer&rsquo;s most common use cases for TinyMCE:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Content Management Systems (<em>e.g. WordPress, Umbraco</em>)</li>\r\n<li>Learning Management Systems (<em>e.g. Blackboard</em>)</li>\r\n<li>Customer Relationship Management and marketing automation (<em>e.g. Marketo</em>)</li>\r\n<li>Email marketing (<em>e.g. Constant Contact</em>)</li>\r\n<li>Content creation in SaaS systems (<em>e.g. Eventbrite, Evernote, GoFundMe, Zendesk</em>)</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">And those use cases are just the start. TinyMCE is incredibly flexible, and with hundreds of APIs there&rsquo;s likely a solution for your editor project. If you haven&rsquo;t experienced Tiny Cloud, get started today. You&rsquo;ll even get a free trial of our premium plugins &ndash; no credit card required!</p>\r\n</div>\r\n</div> ', 'Post Numero 1'),
