(5, '<p>ADS111x Ultra pequeno, de baixa pot&ecirc;ncia, I 2 ADCs compat&iacute;veis com C, 860-SPS e 16<br />bits com refer&ecirc;ncia interna, oscilador e comparador program&aacute;vel</p>\r\n<p>1 1<br />1 Recursos<br />1 1 &bull; Pacote X2QFN ultra pequeno: 2 mm &times;<br />1,5 mm &times; 0,4 mm<br />&bull; Ampla Faixa de Fornecimento: 2,0 V a 5,5 V<br />&bull; Baixo consumo de corrente: 150 &mu; A (modo<br />de convers&atilde;o cont&iacute;nua)<br />&bull; Taxa de dados program&aacute;vel: 8<br />SPS a 860 SPS<br />&bull; Liquida&ccedil;&atilde;o de ciclo &uacute;nico<br />&bull; Refer&ecirc;ncia de tens&atilde;o de baixa tra&ccedil;&atilde;o interna<br />&bull; Oscilador Interno<br />&bull; EU 2 Interface C: Quatro endere&ccedil;os selecion&aacute;veis â€‹por pinos<br />&bull; Quatro entradas de extremidade &uacute;nica ou duas entradas diferenciais<br />(ADS1115)<br />&bull; Comparador program&aacute;vel (ADS1114 e ADS1115)<br />&bull; Faixa de temperatura operacional:j<br />- 40 &deg; C a + 125 &deg; C<br />2 Aplica&ccedil;&otilde;es<br />&bull; Instrumenta&ccedil;&atilde;o port&aacute;til<br />&bull; Monitoramento de corrente e tens&atilde;o da bateria<br />&bull; Sistemas de Medi&ccedil;&atilde;o de Temperatura<br />&bull; Eletr&ocirc;nicos de consumo<br />&bull; Automa&ccedil;&atilde;o de f&aacute;brica e controle de processos</p>\r\n<p>3 Descri&ccedil;&atilde;o<br />Os dispositivos ADS1113, ADS1114 e ADS1115 (ADS111x) s&atilde;o de</p>\r\n<p>precis&atilde;o, de baixa pot&ecirc;ncia, 16 bits, I 2 C-<br />compat&iacute;vel, anal&oacute;gico para digital conversores (ADCs)</p>\r\n<p>oferecido de forma ultra-pequena, sem chumbo, X2QFN-10<br />pacote e um pacote VSSOP-10. Os dispositivos ADS111x incorporam<br />uma refer&ecirc;ncia de voltagem de baixa deriva e um oscilador. O ADS1114<br />e o ADS1115 tamb&eacute;m incorporam um amplificador de ganho<br />program&aacute;vel (PGA) e um comparador digital. Esses recursos,<br />juntamente com uma ampla faixa de suprimento operacional, tornam o<br />ADS111x adequado para aplica&ccedil;&otilde;es de medi&ccedil;&atilde;o de sensor com<br />restri&ccedil;&atilde;o de energia e espa&ccedil;o.<br />O ADS111x realiza convers&otilde;es com taxas de dados de at&eacute; 860<br />amostras por segundo (SPS). O PGA oferece faixas de entrada de<br />&plusmn; 256 mV a &plusmn; 6,144 V, permitindo medi&ccedil;&otilde;es precisas de sinais<br />grandes e pequenos. O ADS1115 possui um multiplexador de<br />entrada (MUX) que permite duas medi&ccedil;&otilde;es de entrada diferenciais<br />ou quatro de extremidade &uacute;nica. Use o comparador digital no<br />ADS1114 e ADS1115 para detec&ccedil;&atilde;o de subtens&atilde;o e sobretens&atilde;o.<br />O ADS111x opera</p>\r\n<p>em qualquer</p>\r\n<p>modo de convers&atilde;o ou modo de disparo &uacute;nico. Os dispositivos s&atilde;o desligados<br />automaticamente ap&oacute;s uma convers&atilde;o no modo de disparo &uacute;nico; portanto, o<br />consumo de energia &eacute; reduzido significativamente durante per&iacute;odos inativos.</p>\r\n<p>Dispositivo Informatio n ( 1)<br />N&Uacute;MERO DA PE&Ccedil;A PACOTE TAMANHO DO CORPO (NOM)<br />ADS111x</p>\r\n<p>X2QFN (10) 1,50 mm &times; 2,00 mm VSSOP<br />(10) 3,00 mm &times; 3,00 mm<br />(1) Para todos os pacotes dispon&iacute;veis, consulte o adendo da op&ccedil;&atilde;o de pacote<br />no final da folha de dados.</p>\r\n<p>Diagramas de blocos simplificados</p>\r\n<p>2<br />ADS1113, ADS1114, ADS1115<br />SBAS444D - MAIO 2009 - REVISADO EM JANEIRO DE 2018 www.ti.com</p>\r\n<p>Links da pasta do produto: ADS1113 ADS1114 ADS1115</p>\r\n<p>Enviar coment&aacute;rios da documenta&ccedil;&atilde;o Copyright &copy; 2009&ndash;2018, Texas Instruments Incorporated</p>\r\n<p>&Iacute;ndice<br />1 Recursos ................................................ .................. 1 1<br />2 Aplica&ccedil;&otilde;es ................................................ ........... 1 1<br />3 Descri&ccedil;&atilde;o ................................................ ............. 1 1<br />4 Hist&oacute;rico de revis&otilde;es ............................................... ...... 2<br />5 Tabela de compara&ccedil;&atilde;o de dispositivos ..................................... 5<br />Configura&ccedil;&atilde;o e fun&ccedil;&otilde;es de 6 pinos ......................... 5<br />7 Especifica&ccedil;&otilde;es ................................................ ......... 6<br />7.1 Classifica&ccedil;&otilde;es m&aacute;ximas absolutas ...................................... 6<br />7.2 Classifica&ccedil;&otilde;es ESD ............................................... ............... 6<br />7.3 Condi&ccedil;&otilde;es operacionais recomendadas ....................... 6<br />7.4 Informa&ccedil;&otilde;es t&eacute;rmicas ............................................... ... 6<br />7.5 Caracter&iacute;sticas el&eacute;tricas .......................................... 7<br />7.6 Requisitos de tempo: I 2 C ......................................... 8<br />7.7 Caracter&iacute;sticas t&iacute;picas .............................................. 9<br />8 Informa&ccedil;&otilde;es sobre medi&ccedil;&atilde;o de par&acirc;metros ................ 13<br />8.1 Desempenho de ru&iacute;do ............................................... .. 13<br />9 Descri&ccedil;&atilde;o detalhada ............................................ 14<br />9.1 Vis&atilde;o geral ................................................ ................. 14<br />9.2 Diagramas de blocos funcionais ..................................... 14<br />9.3 Descri&ccedil;&atilde;o do Recurso ............................................... .. 15<br />9.4 Modos funcionais do dispositivo ........................................ 21</p>\r\n<p>9.5 Programa&ccedil;&atilde;o ................................................</p> ', 'Post ADS 115'),
(6, '<div class=\"demo-inline\">\r\n<div class=\"container\">\r\n<p><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://www.tiny.cloud/images/email-banner-2.png\" width=\"1135\" height=\"147\" /></span></p>\r\n<h1 class=\"tinymce-heading\" style=\"text-align: center;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">The world&rsquo;s first rich text editor in the cloud</span></h1>\r\n<p style=\"text-align: center;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\"><img src=\"https://www.tiny.cloud/images/image-two.jpg\" /></span></p>\r\n<div class=\"tinymce-body\" style=\"text-align: center;\">\r\n<p><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">Have you heard about Tiny Cloud? It&rsquo;s the first step in our journey to help you deliver great content creation experiences, no matter your level of expertise. 50,000 developers already agree. They get free access to our global CDN, image proxy services and auto updates to the TinyMCE editor. They&rsquo;re also ready for some exciting updates coming soon.</span></p>\r\n<p><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">One of these enhancements is <strong>Tiny Drive</strong>: imagine file management for TinyMCE, in the cloud, made super easy. Learn more at <a style=\"background-color: #843fa1;\" href=\"tinydrive/\">tiny.cloud/tinydrive</a>, where you&rsquo;ll find a working demo and an opportunity to provide feedback to the product team.</span></p>\r\n</div>\r\n</div>\r\n<h2 class=\"tinymce-heading\" style=\"text-align: center;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">An editor for every project</span></h2>\r\n<div class=\"tinymce-body\">\r\n<p style=\"text-align: center;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">Here are some of our customer&rsquo;s most common use cases for TinyMCE:</span></p>\r\n<ul style=\"text-align: center;\">\r\n<li><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">Content Management Systems (<em>e.g. WordPress, Umbraco</em>)</span></li>\r\n<li><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">Learning Management Systems (<em>e.g. Blackboard</em>)</span></li>\r\n<li><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">Customer Relationship Management and marketing automation (<em>e.g. Marketo</em>)</span></li>\r\n<li><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">Email marketing (<em>e.g. Constant Contact</em>)</span></li>\r\n<li><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">Content creation in SaaS systems (<em>e.g. Eventbrite, Evernote, GoFundMe, Zendesk</em>)</span></li>\r\n</ul>\r\n<p style=\"text-align: center;\"><span style=\"font-family: verdana, geneva, sans-serif; font-size: 18pt; background-color: #843fa1;\">And those use cases are just the start. TinyMCE is incredibly flexible, and with hundreds of APIs there&rsquo;s likely a solution for your editor project. If you haven&rsquo;t experienced Tiny Cloud, get started today. You&rsquo;ll even get a free trial of our premium plugins &ndash; no credit card required!</span></p>\r\n</div>\r\n</div> ', 'Post do Fulano'),
(7, '<div class=\"demo-inline\">\r\n<div class=\"container\">\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Screenshot from 2020-11-26 09-55-41.png\" src=\"images/blobid0.png\" alt=\"\" width=\"290\" height=\"205\" /></p>\r\n<p><img src=\"https://www.tiny.cloud/images/email-banner-2.png\" /></p>\r\n<h1 class=\"tinymce-heading\">The world&rsquo;s first rich text editor in the cloud</h1>\r\n<p><img src=\"https://www.tiny.cloud/images/image-two.jpg\" /></p>\r\n<div class=\"tinymce-body\">\r\n<p>Have you heard about Tiny Cloud? It&rsquo;s the first step in our journey to help you deliver great content creation experiences, no matter your level of expertise. 50,000 developers already agree. They get free access to our global CDN, image proxy services and auto updates to the TinyMCE editor. They&rsquo;re also ready for some exciting updates coming soon.</p>\r\n<p>One of these enhancements is <strong>Tiny Drive</strong>: imagine file management for TinyMCE, in the cloud, made super easy. Learn more at <a href=\"tinydrive/\">tiny.cloud/tinydrive</a>, where you&rsquo;ll find a working demo and an opportunity to provide feedback to the product team.</p>\r\n</div>\r\n</div>\r\n<h2 class=\"tinymce-heading\">An editor for every project</h2>\r\n<div class=\"tinymce-body\">\r\n<p>Here are some of our customer&rsquo;s most common use cases for TinyMCE:</p>\r\n<ul>\r\n<li>Content Management Systems (<em>e.g. WordPress, Umbraco</em>)</li>\r\n<li>Learning Management Systems (<em>e.g. Blackboard</em>)</li>\r\n<li>Customer Relationship Management and marketing automation (<em>e.g. Marketo</em>)</li>\r\n<li>Email marketing (<em>e.g. Constant Contact</em>)</li>\r\n<li>Content creation in SaaS systems (<em>e.g. Eventbrite, Evernote, GoFundMe, Zendesk</em>)</li>\r\n</ul>\r\n<p>And those use cases are just the start. TinyMCE is incredibly flexible, and with hundreds of APIs there&rsquo;s likely a solution for your editor project. If you haven&rsquo;t exp